import * as BABYLON from 'babylonjs';
require("../../assets/js/vendor/babylon.gridMaterial.min.js");

class Ground {
    constructor(scene) {
        console.log(this);
        this.defaultGround = new BABYLON.MeshBuilder.CreateGround("ground", {}, scene);
    }
}

export default Ground;
